import React from 'react';
import useAuth from "../../hook/useAuth";
import Navbar from './Navbar';
import NavbarLogin from './Navbar2';


const NavbarCall = () => {
    const {user} = useAuth();

  return (
    <div>
        {user
         ? <NavbarLogin/>
         : <Navbar />
        }
    </div>
  );
};

export default NavbarCall;
